import React, { Component } from 'react';

class AboutUs extends Component {
    render(){
        return (
            <div className='container'>
                <div className='row'>
                    <div className='col s8 left-align'>
                        <strong><h4>{ process.env.REACT_APP_ABOUT_TITLE }</h4></strong>
                        <p>{ process.env.REACT_APP_ABOUT_int }</p>
                        <p>- Item 1 </p>
                        <p>- Item 2 </p>
                        <p>- Item 3 </p>
                        <p>{ process.env.REACT_APP_ABOUT_CONCLUSION }</p>
                    </div>
                    <div className='col s4'>
                        <img className="responsive-img" src={require("../../../static/imgs/logo512.png")}/>
                    </div>
                </div>
            </div>
        )
    }
}

export default AboutUs
